pragma solidity >=0.4.21 <0.9.0;
import "./EveeNFT.sol";

library StorageSlot {
    function getAddressAt(bytes32 slot) internal view returns (address a) {
        assembly {
            a := sload(slot)
        }
    }

    function setAddressAt(bytes32 slot, address address_) internal {
        assembly {
            sstore(slot, address_)
        }
    }
}


contract Evee 

  {

	constructor(address _NFTContract, address _eveeLogic){
    	NFTContract = _NFTContract;
    	eveeLogic = _eveeLogic;
    	setImplementation(eveeLogic);
  	}
  address NFTContract;
  address eveeLogic;
  bytes32 private constant _IMPL_SLOT =
  bytes32(uint256(keccak256("eip1967.proxy.implementation")) - 1);
  function setImplementation(address implementation_) public {
    StorageSlot.setAddressAt(_IMPL_SLOT, implementation_);
  }
	event Log_data(string log);
	event refunded(address to , uint refundAmount);
	event commercial_created(bytes _txData, address _attachFrom, address _attachTo, uint balance, uint id );
	event commercial_consumed(bytes _txData, address _attachFrom, address _attachTo, uint balance, uint id  );


	/*NFT - 
	// implement a set uri function and a new transfer that resets uri (or a transfer that requires new uri)
	https://ethereum.stackexchange.com/questions/87853/updating-erc-721-tokens-metadata-after-it-was-minted/87865
	
	https://github.com/nibbstack/erc721/blob/master/src/contracts/mocks/nf-token-metadata-mock.sol
	
	*/
	struct Commercial{
		bytes 	txData;
		address attachFrom;
		address attachTo;
		address owner;
		uint 	gweiAmount;
		bool 	isActive;
		string  uri;
	}
	
	 struct Node {
	    uint256 next;
	    uint256 prev;
	    Commercial com;
	}
	mapping (address => mapping (address => mapping (uint256 => Node)))  commercialsList;
	mapping (address => mapping (address => uint256)) head;
	// check for over flow and empty from the buttom + refound if there's enough monet
	mapping (address => mapping (address => uint256)) idCounter;
	mapping (address => mapping(address => bool)) proxyWhiteList;

	modifier isWhitelisted(address _attFrom, address sender) {
  		if (sender != _attFrom){
			require (proxyWhiteList[_attFrom][sender] == true, 'not in whitelist');
		}
		_;
	}

	function addToWhiteList(address master, address slave) public {
		(bool success, ) = eveeLogic.delegatecall(
            abi.encodeWithSignature("addToWhiteList(address,address)",  master,  slave)
        );
		require (success,'addToWhiteList deleagte call failed');
	}


	function acceptComercial (bytes memory _txData, address _attachFrom, address _attachTo , string memory uri) public payable{
		require (msg.value > 0 , 'fuckityfuckfuck');
		Commercial memory com = Commercial(_txData, _attachFrom, _attachTo, msg.sender, msg.value, true, uri);
		Node memory node = Node (0,idCounter[_attachFrom][_attachTo],com);
		idCounter[_attachFrom][_attachTo] ++;
		commercialsList[_attachFrom][_attachTo][idCounter[_attachFrom][_attachTo]] = node;
		emit commercial_created(com.txData, com.attachFrom, com.attachTo, com.gweiAmount, idCounter[_attachFrom][_attachTo]);
		if (head[_attachFrom][_attachTo] == 0) {
			head[_attachFrom][_attachTo] = idCounter[_attachFrom][_attachTo];
			emit Log_data('head was set');
		}
		else{
			commercialsList[_attachFrom][_attachTo][idCounter[_attachFrom][_attachTo] - 1 ].next = idCounter[_attachFrom][_attachTo];
		}
	}

	function acceptComercial (address _attachFrom, address _attachTo , string memory uri) public payable{
		require (msg.value > 0 , 'fuckityfuckfuck');
		Commercial memory com = Commercial("", _attachFrom, _attachTo, msg.sender, msg.value, true, uri);
		Node memory node = Node (0,idCounter[_attachFrom][_attachTo],com);
		idCounter[_attachFrom][_attachTo] ++;
		commercialsList[_attachFrom][_attachTo][idCounter[_attachFrom][_attachTo]] = node;
		emit commercial_created(com.txData, com.attachFrom, com.attachTo, com.gweiAmount, idCounter[_attachFrom][_attachTo]);
		if (head[_attachFrom][_attachTo] == 0) {
			head[_attachFrom][_attachTo] = idCounter[_attachFrom][_attachTo];
			emit Log_data('head was set');
		}
		else{
			commercialsList[_attachFrom][_attachTo][idCounter[_attachFrom][_attachTo] - 1 ].next = idCounter[_attachFrom][_attachTo];
		}

	}

	// returns a list of commercials ids
	//function myCommecrcialsIds(address _attachFrom ,address attachTo) external returns(uint[] memory){
		 
	//}

	// for an is return the gwei, uri, is active... , if you are the owner
	//function CommercialFromId() returns(,,,){

	//}


	function deleteCommercial(address attachFrom, address attachTo, uint id) private {
		commercialsList[attachFrom][attachTo][id].com.isActive = false;
		if (head[attachFrom][attachTo] ==id){
			head[attachFrom][attachTo] = commercialsList[attachFrom][attachTo][id].next;
			emit Log_data('head was set to 0');
		}
		if (idCounter[attachFrom][attachTo] == id){
			idCounter[attachFrom][attachTo] = commercialsList[attachFrom][attachTo][id].prev;
			emit Log_data('removed from tail');
		}
		if (commercialsList[attachFrom][attachTo][id].prev != 0){
			commercialsList[attachFrom][attachTo][commercialsList[attachFrom][attachTo][id].prev].next = commercialsList[attachFrom][attachTo][id].next;
		}
		if (commercialsList[attachFrom][attachTo][id].next != 0){
			commercialsList[attachFrom][attachTo][commercialsList[attachFrom][attachTo][id].next].prev = commercialsList[attachFrom][attachTo][id].prev;
		}
		emit commercial_consumed(commercialsList[attachFrom][attachTo][id].com.txData, commercialsList[attachFrom][attachTo][id].com.attachFrom,commercialsList[attachFrom][attachTo][id].com.attachTo,commercialsList[attachFrom][attachTo][id].com.gweiAmount, id ); 



	}

	function getCommercial(address attFrom,address remote, uint id) internal isWhitelisted(attFrom, msg.sender) returns (Commercial memory com){
		require(id != 0, 'id cant be 0');
		require (commercialsList[attFrom][remote][id].com.isActive, string(abi.encodePacked('commecial id dont exist',abi.encodePacked(attFrom))));
		com = commercialsList[attFrom][remote][id].com;
		deleteCommercial(attFrom, remote, id);
	}

	function findCommercial(address attachFrom ,address attachTo, uint minGas) view public isWhitelisted(attachFrom, msg.sender) returns (uint){
		uint id = head[attachFrom][attachTo];
		while (id!=0){
			require (commercialsList[attachFrom][attachTo][id].com.isActive, 'Linked list is broken');
			if ((commercialsList[attachFrom][attachTo][id].com.attachTo == attachTo)&&(commercialsList[attachFrom][attachTo][id].com.attachFrom == attachFrom)&&(commercialsList[attachFrom][attachTo][id].com.gweiAmount >= minGas)){
				return (id);
			}
			id = commercialsList[attachFrom][attachTo][id].next;
		}
		return 0;
	}

	function findCommercialArr(address attachFrom ,address attachTo, uint minGas, uint comCount) view public isWhitelisted(attachFrom, msg.sender) returns (uint[] memory){
		uint id = head[attachFrom][attachTo];
		uint [] memory arr = new uint[](comCount);
		uint i = 0;
		while ((id!=0) && (i < comCount-1)){
			require (commercialsList[attachFrom][attachTo][id].com.isActive, 'Linked list is broken');
			if ((commercialsList[attachFrom][attachTo][id].com.attachTo == attachTo)&&(commercialsList[attachFrom][attachTo][id].com.attachFrom == attachFrom)&&(commercialsList[attachFrom][attachTo][id].com.gweiAmount >= minGas)){
				arr[i]=id;
				i++;
			}
			id = commercialsList[attachFrom][attachTo][id].next;
		}
		return arr;
	}


	function encodeEip712DomainHash () view internal returns (bytes32){
		uint chainId; //= chainId();
	    /*assembly {
	      chainId := chainid
	    }*/
	    chainId = 5;
	    return keccak256(
	        abi.encode(
	            keccak256(
	                "EIP712Domain(string name,string version,uint256 chainId,address verifyingContract)"
	            ),
	            keccak256(bytes("Evee")),
	            keccak256(bytes("1")),
	            chainId,
	            address(this)
	        )
	    );  
	}

	function refund(uint amountRequested) private {
		if (address(this).balance < amountRequested){
			//shut down contract for good
			require(false,'Contact is broken');
		}
		payable(msg.sender).transfer(amountRequested);
		emit refunded(msg.sender , amountRequested);
	}

	function getSingerFromSignature(
		uint8 v,
	    bytes32 r,
	    bytes32 s,
			address sender,
	    address remote,
	    uint256 deadline,
	    bytes memory txData
	    ) 
		internal 
		returns(address signer) 
		{
			//bytes memory hashStruct;
			bytes32 hashStruct = keccak256(
		        abi.encode(
		            keccak256("land(bytes txData,address sender,uint deadline)"),
		          	keccak256(txData),
		          	sender,
		          	deadline
		        )
		    );
			//(success, hashStruct) = remote.call(abi.encodeWithSignature('landHash(bytes)', txData, sender, deadline ));
		    //require(success, string(abi.encodePacked(abi.encodePacked("Hash failed call ", ))));
		    bytes32 hash = keccak256(abi.encodePacked("\x19\x01", encodeEip712DomainHash(), hashStruct));
		    signer = ecrecover(hash, v, r, s);
		}

	function toUint256(bytes memory _bytes)   
	  internal
	  pure
	  returns (uint256 value) {

	    assembly {
	      value := mload(add(_bytes, 0x20))
	    }
	}

	function NFTMint   (address owner, string memory uri) internal returns (uint256)
	{
		bytes memory toeknIdBytes;
		bool success; 
		(success , toeknIdBytes) = NFTContract.call(abi.encodeWithSignature(string('mintNew(address,string)'),owner , uri));
		require(success, string(abi.encodePacked("Failed minting ")));
		return (toUint256(toeknIdBytes));
	}

	function sendMessege(address proxy, address remote,uint id , bytes memory txData, address sender) public {
			bool success;
			Commercial memory com = getCommercial(proxy, remote,id);
			uint256 tokenId = NFTMint(com.owner , com.uri);
			if (com.txData.length != 0){
			(success, ) = remote.call(abi.encodeWithSignature(string('land(bytes,bytes,uint256,address,address,address)'),txData,com.txData,tokenId,NFTContract,sender,com.owner));
			} else {
			(success, ) = remote.call(abi.encodeWithSignature(string('land(bytes,uint256,address,address)'),txData,tokenId,NFTContract,sender));
			} 
			require(success, string(abi.encodePacked("Failed call ", string(txData), string(com.txData))));
			refund(com.gweiAmount); 
	}


function _delegate(address impl) internal virtual {
        assembly {
            let ptr := mload(0x40)
            calldatacopy(ptr, 0, calldatasize())

            let result := delegatecall(gas(), impl, ptr, calldatasize(), 0, 0)

            let size := returndatasize()
            returndatacopy(ptr, 0, size)

            switch result
            case 0 {
                revert(ptr, size)
            }
            default {
                return(ptr, size)
            }
        }
    }

    fallback() external {
        _delegate(StorageSlot.getAddressAt(_IMPL_SLOT));
    }


	

  	


}
